import React from "react";
//import { BrowserRouter, Route, Link } from "react-router-dom";

function Navbar() {
    return (
        <nav class="narbar bg-light border navbar navbar-expand-md navbar-light">
            <a class="navbar-brand" href="/"><span class="blue">C</span><span class="red">$</span><span class="yellow">5</span><span class="green">0</span> <span class="red">Finance</span></a>
            <ul class="navbar-nav me-auto mt-2">
                <li class="nav-item"><a class="nav-link" href="/home">Home</a></li>
                <li class="nav-item"><a class="nav-link" href="/tickets">Tickets</a></li>
            </ul>
        </nav>
        /*
        <nav>
            <ul>
                <li>
                    <Link to="/">Login</Link>
                </li>
                <li>
                    <Link to="/home">Home</Link>
                </li>
                <li>
                    <Link to="/tickets">Tickets</Link>
                </li>
            </ul>
        </nav>
        */
    );
}

export default Navbar;
